import React, { useState, useEffect } from "react";
import "../estilos/estiloPagina.css";

class MostrarStats extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            idPartido: props.match.params.idPartido,
            partido: null,
            cargando: true
        }
    }

    componentDidMount() {
        fetch("http://localhost:8080/getPartido?idPartido=")
    }
}

export default MostrarStats;
